static __inline td_void ot_isp_slave_mode_sync_write(ot_slave_dev slave_dev)
{
    switch (slave_dev) {
        case 0: /* slave 0 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 0, 0, 1);
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 0, 0, 0);
            break;
        case 1: /* slave 1 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 1, 1, 1);
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 1, 1, 0);
            break;
        case 2: /* slave 2 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 2, 2, 1);
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 2, 2, 0);
            break;
        case 3: /* slave 3 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 3, 3, 1);
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_SYNC, 3, 3, 0);
            break;
        default:
            break;
    }
}

static __inline td_void ot_isp_slave_mode_time_cfg_select_write(ot_slave_dev slave_dev, td_u32 data)
{
    switch (slave_dev) {
        case 0: /* slave 0 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 1, 0, data);
            break;
        case 1: /* slave 1 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 3, 2, data);
            break;
        case 2: /* slave 2 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 5, 4, data);
            break;
        case 3: /* slave 3 */
            reg_bits_modify(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 7, 6, data);
            break;
        default:
            break;
    }
}

static __inline td_u32 ot_isp_slave_mode_time_cfg_select_read(ot_slave_dev slave_dev)
{
    switch (slave_dev) {
        case 0: /* slave 0 */
            return reg_bits_read(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 1, 0);
        case 1: /* slave 1 */
            return reg_bits_read(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 3, 2);
        case 2: /* slave 2 */
            return reg_bits_read(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 5, 4);
        case 3: /* slave 3 */
            return reg_bits_read(iowr_32direct, iord_32direct, SLAVE_MODE_REG_BASE, 7, 6);
        default:
            return 0;
    }
}

